import React, { Component } from 'react';

export default class SystemDetails extends Component {
  constructor(props) {
    super(props);
    this.state = {
      systemData : require("../../../_temp/system.json")
    };
  }

  componentDidMount() {
    console.log(this.state.systemData.system[0].description)
  }

  render() {
    return (
      <div className="System">
          <h1>{this.state.systemData.system[0].description}</h1>
      </div>
    )
  }
}
